import React from "react";
import TodoElem from "./TodoElem"

function TodoList(todos) {
    var contents = todos?.map(todo => (
        <TodoElem key = {todo.id} todo = {todo} />
    ));
    return (

        <ul>
            {contents? contents: <p>No task yet</p>}
        </ul>
        );
    }
    

    export default TodoList;
